import { LegacyRef } from "react";
import { View, StyleSheet, createElement } from "react-native";

const dotCSSInfo = {
  width: 10,
  height: 10,
  unit: "px",
};

const inputTypePasswordCSSInfo = {
  width: 200,
  height: 100,
  unit: "px",
};

const DivElement = createElement("div");

const AuroraPasswordInputComponent = () => {
  const attachShadow = (host: Element): LegacyRef<View> | undefined => {
    host.attachShadow({ mode: "open" });
    return undefined;
  };
  // return <View ref={attachShadow} style={styles.membrane}></View>;
  return <DivElement ref={attachShadow} style={styles.membrane}></DivElement>;
};

const styles = StyleSheet.create({
  membrane: {
    height: 100,
    width: 200,
    borderWidth: 1,
    borderColor: "#111",
    borderStyle: "solid",
  },
});

export default AuroraPasswordInputComponent;
